    image: "product_label.mov",
  },
  {
    id: "addPin",
    title: "Êñ∞Â¢ûÊ®ôÈªû",
    content:
      "ÈÄèÈÅéÈóúÈçµÂ≠óÊêúÂ∞ãÊàñÊòØÂú∞ÂúñÈáòÈÅ∏‰æÜÂø´ÈÄüÊñ∞Â¢ûÂú∞Ê®ôÔºåËÄåÂú∞Ê®ôË≥áË®ä‰πü‰πãÂæåÂèØÂÜçÁ∑®ËºØ",
