    title: "Ë≥áË®äÂç°",
    content: "‰ª•ÂúñÈëëË≥áË®äÂç°ÁöÑÊ®£ÂºèÔºåÁ∂≤ÁæÖÂ§ßÂÆ∂Ë∏©Ë©≤ÈªûÂàÜ‰∫´ÁöÑÁÖßÁâáÂíåÂøÉÂæó",
    image: "product_infoCard.mov",
