                      <motion.div
                        key={activeTab.id + "_fade"}
                        className="screenTransition"
                        initial={{ opacity: 1, scale: 1.05 }}
                        animate={{
                          opacity: 0,
                          scale: 1,
                          transition: {
                            opacity: { duration: 0.8, ease: "easeInOut" },
