                  <img
                    className="frame_overlay"
                    src="/asset/frame.png"
                    alt="frame overlay"
                  />
                </div>
              ) : (
                /* üí§ Ê≤íÈÅ∏ÂèñÊôÇÈ°ØÁ§∫Â∞ÅÈù¢ÁÖß */
